import React, { useState, useEffect } from "react";
import { AllStars } from "./types/types";

function App() {
  const [allStarsHook, setAllStarsHook] = useState<AllStars>();

  const getStars = async () => {
    try {
      const apiResponse = await fetch("http://localhost:777/getStars", {
        method: "GET",
        headers: {
          "Content-Type": "application/json",
        },
      });
      const json = await apiResponse.json();
      setAllStarsHook(json);
    } catch (e) {
      console.log(e);
    }
  };

  useEffect(() => {
    getStars();
  }, []);

  return <div>ELO</div>;
}

export default App;
